import React from "react";
import '../styles/about.css';
import anchorIcon from "../resource/anchor.png"
import {headerContentData} from "../actions/headerContent";
import {connect} from "react-redux"
class About extends React.Component{
    componentDidMount() {

        this.props.fetchData("http://localhost/backend/header.php");

    }

    render(){
    return(
        <div className="aboutContent" id="about">
            <img src={anchorIcon} alt="Anchor"/>
            <h1>
                We are Oshine, a beautiful responsive multi-purpose wordpress theme that<br/>
                comes with 15 unique and stunning demos. We have crafted each and every<br/>
                demo with extensive care and precision and the theme is power packed yet<br/>
                easy to use.
            </h1>
            <button>OUR WORK</button>
        </div>
    )}
}
const mapStateToProps = state => ({
    headerContent: state.header
});

const mapDispatchToProps = dispatch => ({
    fetchData: url => dispatch(headerContentData(url))
});
export default connect(mapStateToProps, mapDispatchToProps)(About)
